Official mobile app of Sheremetyevo International Airport.

With this app the airport's passengers and visitors can:
- Get up-to-date flight information: check-in opening and closing times, check-in counters and boarding gates, baggage claim area, flight delays or cancellations;
- Find shops, restaurants, and infrastructure facilities on a map of the airport;
- Order assistance for people with disabilities at the airport;
- Learn about promotions and special offers provided by shops and restaurants in the airport;
- Check transport routes and schedules to/from the airport;
- Study the rules of pre-flight and post-flight inspections, traveling with children, and checking in special baggage.

We look forward to your ratings and reviews!

